import "./PageTemplateStyles.css";
import home_bg from "../assets/class-image.png"

function PageTemplate (){
    return(
        <>
           <div className="template">
            <img src = { home_bg } alt="TempImg" className="bgimg"/>
           </div>
        </>
    )

}

export default PageTemplate;
